import React from 'react';
import { Link } from 'react-router-dom';
import './navbar.css';
import axios from 'axios';



function NavBar(){
    return (
        <div>
            <NavBar bg="dark" variant="dark">
           
                 <Link  to='/login'>
                    <li> Logins </li>
                </Link>
                </NavBar>
            </div>
    );
}

export default NavBar;
